@_jeongro 속합니다. 의존성이 낮은 약물에 속합니다.
  우리가 ‘졸피뎀’이라 부르는 건 ‘스틸녹스’란 상품명을 갖고 있는데, 지금은 특허가 만료되어 졸피뎀(산도스), 파마주석산졸피뎀(한국파마), 졸피신(명인), 졸피람(환인), 졸피드(한미) 등으로 카피약이 나오고 있습니다. 
올리신 약물은 ‘스틸녹스’ 즉,

@Goo_ok_Soo_o 마법소년 스틸녹스
아래에는 반바지와 프릴 달린 니삭스일 것만 같습니다
부모님께 들켜서는 안 될 복장

@Goo_ok_Soo_o 변신하면 아예 다른 사람이었다면 좀 나았을 텐데
회춘한 본인이 될 뿐...
환자분이 마법소년 스틸녹스 나오는 뉴스라도 보고 있으면 정말 괴롭겠어요 어 수상할 정도로 스틸녹스랑 닮은 간호사쌤이다

@blaxkwxite 잘 살고 있으리라 믿습니다...
닥구와씨는 스틸녹스 닮았다는 소리 안 듣고 살고 있기를
정체들키면 개쪽이에요 이사가고싶어지는데 일본은 이사비용이 비싸요

